selector_to_html = {"a[href=\"#grupperet-observationer\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.3.2. </span>Grupperet observationer<a class=\"headerlink\" href=\"#grupperet-observationer\" title=\"Permalink til denne overskrift\">#</a></h2><h3><span class=\"section-number\">12.3.2.1. </span>Gennemsnit<a class=\"headerlink\" href=\"#id1\" title=\"Permalink til denne overskrift\">#</a></h3>", "a[href=\"#equation-eq-gennemsnit2\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-gennemsnit2\">\n\\[    \\bar{x} = \\frac{h_1 x_1 + h_2 x_2 + \\cdots + h_n x_n}{n} = \\frac{1}{n}\\sum_{i=1}^{n} h_i x_i \\]</div>", "a[href=\"#equation-eq-min\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-min\">\n\\[    x_{\\text{min}} = \\min\\{x_1,x_2,...,x_n\\} = \\min_{i=1,2,...,n}\\{x_i\\} \n    \n\\]</div>", "a[href=\"#karakterereksempel3\"]": "<div class=\"proof eksempel admonition\" id=\"karakterereksempel3\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Eksempel 12.4 </span> (Karakterer - fortsat)</p>\n<section class=\"eksempel-content\" id=\"proof-content\">\n<p>Lad os beregne gennemsnittet. Bem\u00e6rk igen, at vi skriver <span class=\"math notranslate nohighlight\">\\(2\\)</span> for karakteren <span class=\"math notranslate nohighlight\">\\(02\\)</span>:</p>\n<div class=\"math notranslate nohighlight\">\n\\[\\begin{split}\n \\begin{align*}\n    \\bar{x} &amp;= \\frac{4+4+10+2+12+12+7+7+7+12+4+10+7+7+2+7+10+10+7+7}{20} \\\\\n        &amp;= \\frac{148}{20} \\\\\n        &amp;= 7{,}4\n \\end{align*}\n \\end{split}\\]</div>\n<p>Vi har alts\u00e5, at eleverne i gennemsnit har f\u00e5et ca. <span class=\"math notranslate nohighlight\">\\(7\\)</span>.</p>\n</section>\n</div>", "a[href=\"#id1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.3.2.1. </span>Gennemsnit<a class=\"headerlink\" href=\"#id1\" title=\"Permalink til denne overskrift\">#</a></h3>", "a[href=\"#equation-eq-stikproevevarians2\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-stikproevevarians2\">\n\\[    s^2 = \\sum_{i=1}^{n} f_i (x_i - \\bar{x})^2 \\]</div>", "a[href=\"#variationsbredde\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.3.1.2. </span>Variationsbredde<a class=\"headerlink\" href=\"#variationsbredde\" title=\"Permalink til denne overskrift\">#</a></h3><p>Variationsbredden er den statistiske deskriptor, der beskriver afstanden mellem datas\u00e6ttets mindste- og st\u00f8rstev\u00e6rdi. Vi ben\u00e6vner variationsbredden med <span class=\"math notranslate nohighlight\">\\(R\\)</span> for det engelske <em>range</em>:</p>", "a[href=\"#equation-eq-range\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-range\">\n\\[    R = x_{\\text{max}} - x_{\\text{min}} \\]</div>", "a[href=\"grundlaeggende-begreber-deskriptiv-statistik.html#karakterereksempel2\"]": "<div class=\"proof eksempel admonition\" id=\"karakterereksempel2\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Eksempel 12.2 </span> (Karakterer - fortsat)</p>\n<section class=\"eksempel-content\" id=\"proof-content\">\n<p>Vi forts\u00e6tter med datas\u00e6ttet fra <a class=\"reference internal\" href=\"#karakterereksempel\">Eksempel 12.1</a> og udvider vores tabel med den kumuleret frekvens. Den kumuleret frekvens af vores f\u00f8rste observation er blot lig frekvensen, s\u00e5 <span class=\"math notranslate nohighlight\">\\(F_1 = 0{,}1\\)</span>. Nu kan vi bruge vores formel.</p>\n<div class=\"math notranslate nohighlight\">\n\\[\\begin{split}\n\\begin{align*}\n    F_2 &amp;= F_1 + f_2 = 0{,}1 + 0{,}15 = 0{,}25 \\\\\n    F_3 &amp;= F_2 + f_3 = 0{,}25 + 0{,}4 = 0{,}65 \\\\\n    F_4 &amp;= F_3 + f_4 = 0{,}65 + 0{,}2 = 0{,}85 \\\\\n    F_5 &amp;= F_4 + f_5 = 0{,}85 + 0{,}15 = 1 \n\\end{align*}\n\\end{split}\\]</div>\n<table class=\"colwidths-auto table\">\n<thead>\n<tr class=\"row-odd\"><th class=\"head\"><p>Observation <span class=\"math notranslate nohighlight\">\\((x_i)\\)</span></p></th>\n<th class=\"head\"><p>Hyppighed <span class=\"math notranslate nohighlight\">\\((h_i)\\)</span></p></th>\n<th class=\"head\"><p>Frekvens <span class=\"math notranslate nohighlight\">\\((f_i)\\)</span></p></th>\n<th class=\"head\"><p>Kumuleret frekvens <span class=\"math notranslate nohighlight\">\\((F_i)\\)</span></p></th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"row-even\"><td><p><span class=\"math notranslate nohighlight\">\\(02\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(2\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(\\frac{2}{20} = 0{,}1\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(0{,}1\\)</span></p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><span class=\"math notranslate nohighlight\">\\(4\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(4\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(\\frac{4}{20} = 0{,}2\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(0{,}1 + 0{,}15 = 0{,}25\\)</span></p></td>\n</tr>\n<tr class=\"row-even\"><td><p><span class=\"math notranslate nohighlight\">\\(7\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(7\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(\\frac{7}{20} = 0{,}35\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(0{,}25 + 0{,}4 = 0{,}65\\)</span></p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><span class=\"math notranslate nohighlight\">\\(10\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(4\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(\\frac{4}{20} = 0{,}2\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(0{,}65 + 0{,}2 = 0{,}85\\)</span></p></td>\n</tr>\n<tr class=\"row-even\"><td><p><span class=\"math notranslate nohighlight\">\\(12\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(3\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(\\frac{3}{20} = 0{,}15\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(0{,}85 + 0{,}15 = 1\\)</span></p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><strong>I alt</strong></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(20\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(1\\)</span></p></td>\n<td><p></p></td>\n</tr>\n</tbody>\n</table>\n</section>\n</div>", "a[href=\"#equation-eq-1kvartil\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-1kvartil\">\n\\[    Q_1 = \\underset{i=1,2,...,n}{\\arg\\,\\sup} \\{x_i \\mid F_i \\geq 0{,}25\\} \\]</div>", "a[href=\"#kvartilafstand\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.3.1.6. </span>Kvartilafstand<a class=\"headerlink\" href=\"#kvartilafstand\" title=\"Permalink til denne overskrift\">#</a></h3><p>Ligesom variationsbredden, s\u00e5 er kvartilafstanden ogs\u00e5 et spredningsm\u00e5l og blot afstanden mellem den \u00f8vre og nedre kvartil. Vi ben\u00e6vner kvartilafstanden med <span class=\"math notranslate nohighlight\">\\(R_Q\\)</span>:</p>", "a[href=\"#median\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.3.1.4. </span>Median<a class=\"headerlink\" href=\"#median\" title=\"Permalink til denne overskrift\">#</a></h3><p>I folkeskolen l\u00e6rte du sikkert i statistik, at medianen er den statistiske deskriptor, der giver den midterste observation i det ordnede datas\u00e6t. S\u00e5, hvis vi har et datas\u00e6t med ni observationer <span class=\"math notranslate nohighlight\">\\(x_1,x_2,...,x_9\\)</span>, s\u00e5 kan vi ordne observationerne:</p>", "a[href=\"#equation-eq-max\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-max\">\n\\[    x_{\\text{max}} = \\max\\{x_1,x_2,...,x_n\\} = \\max_{i=1,2,...,n}\\{x_i\\} \n    \n\\]</div>", "a[href=\"#gennemsnit\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.3.1.3. </span>Gennemsnit<a class=\"headerlink\" href=\"#gennemsnit\" title=\"Permalink til denne overskrift\">#</a></h3><p>Den statistiske deskriptor, som de fleste nok kender, er <em>gennemsnittet</em>. Den kaldes ogs\u00e5 for <em>middelv\u00e6rdi</em> eller <em>middeltal</em>. Det skyldes, at gennemsnittet er en nem st\u00f8rrelse at beregne og fortolke p\u00e5. Gennemsnittet er et tal, der beskriver den centrale tendens for datas\u00e6ttet og fort\u00e6ller noget om observationernes v\u00e6gtet forekomst. Observationer der forekommer flere gange vil derfor tr\u00e6kke gennemsnittet i retning af de observationers v\u00e6rdier.</p><p>Vi betragter stikpr\u00f8ven</p>", "a[href=\"#equation-eq-spredning\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-spredning\">\n\\[    s = \\sqrt{s^2} = \\sqrt{\\frac{1}{n}\\sum_{i=1}^{n} (x_i - \\bar{x})^2} \\]</div>", "a[href=\"#equation-eq-median\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-median\">\n\\[    x_{\\text{median}} = \\underset{i=1,2,...,n}{\\arg\\,\\sup} \\{x_i \\mid F_i \\geq 0{,}5\\} \\]</div>", "a[href=\"#mindste-og-storstevaerdi\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.3.1.1. </span>Mindste- og st\u00f8rstev\u00e6rdi<a class=\"headerlink\" href=\"#mindste-og-storstevaerdi\" title=\"Permalink til denne overskrift\">#</a></h3><p>Mindste- og st\u00f8rstev\u00e6rdien er statistiske deskriptorer, der som navnet indikerer, fort\u00e6ller hvad datas\u00e6ttets mindste og st\u00f8rste observation er. Disse deskriptorer giver en id\u00e9 om det sp\u00e6nd vores observationer befinder sig i og afstanden mellem disse kalder vi for <em>variationsbredden</em>.</p><p>Vi kan ved hj\u00e6lp af <span class=\"math notranslate nohighlight\">\\(\\min\\)</span>- og <span class=\"math notranslate nohighlight\">\\(\\max\\)</span>-funktionerne finde den mindste og st\u00f8rste v\u00e6rdi blandt observationerne. Funktionen <span class=\"math notranslate nohighlight\">\\(\\min\\)</span> giver den mindste v\u00e6rdi, der inputtes i funktionen og <span class=\"math notranslate nohighlight\">\\(\\max\\)</span> giver den st\u00f8rste v\u00e6rdi, der inputtes i funktionen.</p>", "a[href=\"#equation-eq-kvartilafstand\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-kvartilafstand\">\n\\[    R_Q = Q_3 - Q_1 \\]</div>", "a[href=\"#equation-eq-stikproevevarians\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-stikproevevarians\">\n\\[    s^2 = \\frac{(x_1 - \\bar{x})^2 + (x_2 - \\bar{x})^2 + \\cdots + (x_n - \\bar{x})^2}{n} = \\frac{1}{n}\\sum_{i=1}^{n} (x_i - \\bar{x})^2 \\]</div>", "a[href=\"#statistiske-deskriptorer\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.3. </span>Statistiske deskriptorer<a class=\"headerlink\" href=\"#statistiske-deskriptorer\" title=\"Permalink til denne overskrift\">#</a></h1><p>I deskriptiv statistik benytter vi os af deskriptorer til at sige noget om vores datas\u00e6t. Deskriptorerne er nogle m\u00e5l, der samler vores observationer og giver os et enkelt tal, der kan hj\u00e6lpe os med at sige noget om vores data. Vi vil i dette kapitel introducere de forskellige deskriptorer.</p><p>Vi deler vores statistiske deskriptorer op i to grupper, nemlig <em>positionsm\u00e5l</em> og <em>spredningsm\u00e5l</em>. Vi har f\u00f8lgende positionsm\u00e5l:</p>", "a[href=\"#equation-eq-gennemsnit\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-gennemsnit\">\n\\[    \\bar{x} = \\frac{x_1 + x_2 + \\cdots + x_n}{n} = \\frac{1}{n} \\sum_{i=1}^{n} x_i \\]</div>", "a[href=\"#ugrupperet-observationer\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.3.1. </span>Ugrupperet observationer<a class=\"headerlink\" href=\"#ugrupperet-observationer\" title=\"Permalink til denne overskrift\">#</a></h2><h3><span class=\"section-number\">12.3.1.1. </span>Mindste- og st\u00f8rstev\u00e6rdi<a class=\"headerlink\" href=\"#mindste-og-storstevaerdi\" title=\"Permalink til denne overskrift\">#</a></h3><p>Mindste- og st\u00f8rstev\u00e6rdien er statistiske deskriptorer, der som navnet indikerer, fort\u00e6ller hvad datas\u00e6ttets mindste og st\u00f8rste observation er. Disse deskriptorer giver en id\u00e9 om det sp\u00e6nd vores observationer befinder sig i og afstanden mellem disse kalder vi for <em>variationsbredden</em>.</p><p>Vi kan ved hj\u00e6lp af <span class=\"math notranslate nohighlight\">\\(\\min\\)</span>- og <span class=\"math notranslate nohighlight\">\\(\\max\\)</span>-funktionerne finde den mindste og st\u00f8rste v\u00e6rdi blandt observationerne. Funktionen <span class=\"math notranslate nohighlight\">\\(\\min\\)</span> giver den mindste v\u00e6rdi, der inputtes i funktionen og <span class=\"math notranslate nohighlight\">\\(\\max\\)</span> giver den st\u00f8rste v\u00e6rdi, der inputtes i funktionen.</p>", "a[href=\"#equation-eq-3kvartil\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-3kvartil\">\n\\[    Q_3 = \\underset{i=1,2,...,n}{\\arg\\,\\sup} \\{x_i \\mid F_i \\geq 0{,}75\\} \\]</div>", "a[href=\"#opgaver\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.3.3. </span>Opgaver<a class=\"headerlink\" href=\"#opgaver\" title=\"Permalink til denne overskrift\">#</a></h2>", "a[href=\"#stikprovevarians-og-spredning\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.3.1.7. </span>Stikpr\u00f8vevarians og spredning<a class=\"headerlink\" href=\"#stikprovevarians-og-spredning\" title=\"Permalink til denne overskrift\">#</a></h3><p>De sidste to deskriptorer, som vi skal have styr p\u00e5, er, stikpr\u00f8vevarians og spredning. Eftersom spredning er defineret ud fra stikpr\u00f8vevariansen, starter vi med denne deskriptor.</p><p>Stikpr\u00f8vevariansen er et meget anvendt spredningsm\u00e5l, da det kigger p\u00e5, hvor meget observationerne i gennemsnit afviger fra gennemsnittet. Faktisk er det den kvadratiske afstand fra gennemsnittet. Vi har stikpr\u00f8ven <span class=\"math notranslate nohighlight\">\\(x_1,x_2,...,x_n\\)</span> og definerer:</p>", "a[href=\"#kvartiler-og-fraktiler\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.3.1.5. </span>Kvartiler og fraktiler<a class=\"headerlink\" href=\"#kvartiler-og-fraktiler\" title=\"Permalink til denne overskrift\">#</a></h3><p>Vi arbejder med tre kvartiler:</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
